INSERT INTO `aboutuses` (`id`, `description_one`, `description_two`, `image`, `content`, `bg_color`, `feature1_icon`, `feature1_title`, `feature1_description`, `feature2_icon`, `feature2_title`, `feature2_description`, `feature3_icon`, `feature3_title`, `feature3_description`, `client_bg_img`, `client_title`, `client_description`, `status`, `created_at`, `updated_at`) VALUES (5,'<div>Skill Development Centre (SDC) – Bangladesh was established in the year 2003. For the decades, we already ushered a significant number of highly skilled manpower to Asia &amp; to other parts of the world. SDC Overseas Training &amp; Testing Centre Ltd-Bangladesh is considered to be the largest centre in Asia which was approved by ITE Singapore for MARINE &amp; PCM Sector. At a time, the centre can accommodate 30 welding trainees, 20 steel fitters, 20 pipe fitters, 20 electrical fitters, and 18 mechanical fitters, at a time. The centre is fully equipped with facilities such as classrooms, interview rooms, waiting areas, and offices—readily available to provide convenience to our clients as well as to our applicants. Similarly, we have workers accommodation prepared for applicants undergoing training and for those residing outside Dhaka. Basically, we have tailored our facilities to meet everyone’s need. Furthermore, currently, we have sufficient technical staff employed full-time at the centre.</div>','<br>','5.jpg',NULL,'#0066c2','fa fa-graduation-cap','29','Total Trade courses','fas fa-user','1520','Total Trainee','fas fa-award','4021','Course Complete Trainee','1686647370.5.jpg','Our Valued Client','Thank you for being our valued customers. We are grateful for the pleasure of serving you and meeting your clothing needs.',0,'2023-06-19 12:44:40','2023-06-19 12:44:40');
