INSERT INTO `blogs` (`id`, `title`, `short_description`, `image`, `description`, `status`, `type`, `created_at`, `updated_at`) VALUES (11,'কোরিয়া যাওয়ার প্রস্তুতি, আমাদের ছাত্রদের। SDC training center','ভিসা এবং অন্যান্য দায়িত্ব: প্রথমে আপনাদের ব্যক্তিগত ডকুমেন্ট এবং অন্যান্য প্রয়োজনীয় দায়িত্ব সম্পর্কে সাবধানতা অনুসরণ করা উচিত।\r\n\r\nভাষা ও কাল্চারাল অবস্থান: কোরিয়ান ভাষা এবং কাল্চারাল সংস্কৃতি সম্পর্কে অবশ্যই ধারণা থাকতে হবে। কিছু কোরিয়ান ভাষা ক্লাস অনলাইনে অনুষ্ঠিত হয়, যা আপনাদের ভাষা স্কিল উন্নত করতে সাহায্য করতে পারে।\r\n\r\nকোরিয়ান ক্যালচার এবং সামাজিক অবস্থা: কোরিয়ান কালচার ও সামাজিক অবস্থা সম্পর্কে জানা অত্যন্ত গুরুত্বপূর্ণ। এটি আপনাদের কোরিয়ান ভাষা এবং সম্প্রদায়ের সাথে সংশ্লিষ্ট হওয়ায় সাহায্য করবে।\r\n\r\nঅধ্যয়ন এবং পেশা সংক্রান্ত প্রস্তুতি: আপনি যদি কোরিয়াতে অধ্যয়ন বা কাজ করতে চান, তবে সেই ক্ষেত্রে আপনার আগের প্রস্তুতি নেওয়া উচিত। এটি শিক্ষার সুযোগ, কর্ম বা ব্যবসা সংক্রান্ত প্রস্তুতি অনুসন্ধানে সাহায্য করতে পারে।\r\n\r\nআর্থিক পরিস্থিতি: অর্থনৈতিক প্রস্তুতি সম্পর্কে ভালো ধারণা থাকা গুরুত্বপূর্ণ। বিদেশে যাওয়া এবং অতিথি বসবাসের জন্য অর্থনৈতিক পরিস্থিতি সম্পর্কে আগে ধারণা থাকা উচিত।\r\n\r\nআমি আশা করি এই ধাপগুলি আপনাদের কোরিয়া যাওয়ার প্রস্তুতিতে সাহায্য করবে। সফল ভ্রমণের জন্য শুভকামনা রইলো!','11.jpg','<p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/-frtr4vlOms\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 07:24:12','2024-05-12 07:24:13'),(12,'বিদেশের অভিজ্ঞতা ছাড়াই পেয়ে গেলাম দক্ষিণ কোরিয়ার ভিসা ✅ SDC training center #ওয়েল্ডিং','বিদেশের অভিজ্ঞতা ছাড়াই পেয়ে গেলাম দক্ষিণ কোরিয়ার ভিসা ✅ SDC training center #ওয়েল্ডিং','12.jpg','<p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/Y1Ic31hGM2k\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 07:35:43','2024-05-12 07:35:43'),(13,'প্রশিক্ষণ দিয়ে, বিদেশে কর্মী পাঠিয়ে থাকি, বিস্তারিত জেনে নিন। SDC training center','প্রশিক্ষণ দিয়ে, বিদেশে কর্মী পাঠিয়ে থাকি, বিস্তারিত জেনে নিন। SDC training center','13.jpg','<p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/W_lobr-6veI\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 07:40:06','2024-05-12 07:40:06'),(14,'যেনোতেনো কাজে যেনোতেনো কোম্পানিতে বিদেশ যাওয়া যাবে না','যেনোতেনো কাজে যেনোতেনো কোম্পানিতে বিদেশ যাওয়া যাবে না। \r\n: আলমগীর কবির, ম্যানেজিং ডিরেক্টর, এসডিসি সেন্টার','14.jpg','<p><iframe frameborder=\"0\" src=\"https://www.facebook.com/plugins/video.php?href=www.facebook.com%2FCENTERSDC%2Fvideos%2F1004220857801527&amp;show_text=0&amp;width=560\" width=\"560\" height=\"301\" scrolling=\"no\" allowtransparency=\"true\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 10:46:53','2024-05-12 10:46:53'),(16,'আমাদের ট্রেনিং সমূহ','আমাদের ট্রেনিং সমূহ\r\n##ওয়েল্ডিং ট্রেনিং##\r\n১. 3জি ওয়েল্ডিং\r\n২. 4জি ওয়েল্ডিং\r\n৩. 6জি ওয়েল্ডিং\r\n৪. টি আই জি ওয়েল্ডিং\r\n## ফিটার ট্রেনিং##\r\n১.পাইপ ফিটিং\r\n২. স্টিল ফিটিং\r\n৩.ইলেকট্রিক্যাল\r\n৪. মেকানিক্যাল\r\n৩ মাস ট্রেনিং\r\nফিস: ৩‌‌৫৭০০ টাকা।\r\nঅফিসের ঠিকানা\r\nএসডিসি ট্রেনিং সেন্টার\r\nগুলগুলার মোড়, (তুরাগ পুরাতন থানার পাশে) কামারপাড়া, তুরাগ, ঢাকা।\r\n01911941194\r\n01977442211','16.jpg','<p><iframe frameborder=\"0\" src=\"https://www.facebook.com/plugins/video.php?href=www.facebook.com%2FCENTERSDC%2Fvideos%2F818909466813964&amp;show_text=0&amp;width=560\" width=\"560\" height=\"301\" scrolling=\"no\" allowtransparency=\"true\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 11:06:20','2024-05-12 11:06:20'),(17,'ফেইসবুক পেইজ দেখে সেন্টারে এসে কাজ শিখে আজ আমি দক্ষিণ কোরিয়া যাচ্ছি','ফেইসবুক পেইজ দেখে সেন্টারে এসে কাজ শিখে আজ আমি দক্ষিণ কোরিয়া যাচ্ছি','17.jpg','<p><iframe frameborder=\"0\" src=\"https://www.facebook.com/plugins/video.php?href=www.facebook.com%2FCENTERSDC%2Fvideos%2F1776699072816937&amp;show_text=0&amp;width=560\" width=\"560\" height=\"301\" scrolling=\"no\" allowtransparency=\"true\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-12 11:42:09','2024-05-12 11:42:10'),(18,'দক্ষিণ কোরিয়াতে কিভাবে যেতে হয়। South Korea E7 visa update.','আপনার সিভি, ছবি, বায়ো-ডাটা, কাজের অভিজ্ঞতা সার্টিফিকেট ও অন্যান্য কাগজপত্র ইমেইল পাঠান। sdccenterbd@gmail.com অফিসের ঠিকানা এসডিসি ট্রেনিং সেন্টার গুলগুলার মোড়, (তুরাগ থানার পাশে) কামারপাড়া, তুরাগ, ঢাকা। 01911941194, 01918294243, 01680088888, 01977442211 https://maps.app.goo.gl/nbycXCet7fGJ5...','18.png','<p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/g-ZMj1XfFPc\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',0,'blog','2024-05-14 04:24:33','2024-05-14 04:24:34');
