g',NULL,NULL,NULL,0,'2023-06-20 08:52:50','2024-05-11 10:11:22'),(13,1,'Duct Fabrication','Duct Fabrication','13.jpg',NULL,NULL,NULL,0,'2023-06-20 08:53:26','2024-05-11 10:11:28'),(14,1,'Electrician','Electrician','14.jpg',NULL,NULL,NULL,0,'2023-06-20 08:55:01','2024-05-11 10:11:33'),(15,1,'Cladding Installation','Cladding Installation','15.jpg',NULL,NULL,NULL,0,'2023-06-20 09:10:12','2023-06-20 09:10:12'),(16,1,'Fiber Plaster Ceiling','Fiber Plaster Ceiling','16.jpg',NULL,NULL,NULL,0,'2023-06-20 09:11:28','2023-06-20 09:11:28'),(17,1,'Fire Sprinkler Installation','Fire Sprinkler Installation','17.jpg',NULL,NULL,NULL,0,'2023-06-20 09:13:17','2023-06-20 09:13:17'),(18,1,'Glazing','Glazing','18.jpg',NULL,NULL,NULL,0,'2023-06-20 09:16:42','2023-06-20 09:16:42'),(19,1,'Timber Formwork','Timber Formwork','19.jpg',NULL,NULL,NULL,0,'2023-06-20 09:18:23','2023-06-20 09:18:23'),(20,1,'Water Proofing','Water Proofing','20.jpg',NULL,NULL,NULL,0,'2023-06-20 09:20:31','2023-06-20 09:20:31'),(21,1,'Aluminum Windows & Door','Aluminum Windows & Door','21.jpg',NULL,NULL,NULL,0,'2023-06-20 09:22:01','2023-06-20 09:22:01'),(22,6,'PIPE FITTER','PIPE FITTER','22.jpg',NULL,NULL,NULL,0,'2023-12-20 11:20:19','2023-12-20 11:20:19'),(23,1,'Steel Structure','Steel Structure','23.jpg',NULL,NULL,NULL,0,'2023-06-20 09:24:44','2023-06-20 09:24:44'),(24,1,'Concreting','Concreting','24.jpg',NULL,NULL,NULL,0,'2023-06-20 09:28:04','2023-06-20 09:28:04'),(25,1,'Aluminum Formwork','Aluminum Formwork','25.jpg',NULL,NULL,NULL,0,'2023-06-20 09:28:49','2023-06-20 09:28:49'),(26,1,'Mason Stucco','Mason Stucco','26.jpg',NULL,NULL,NULL,0,'2023-06-20 09:30:41','2023-06-20 09:30:41'),(27,1,'General Mechanical','General Mechanical','27.jpg',NULL,NULL,NULL,0,'2023-06-20 09:31:37','2023-06-20 09:31:37'),(28,1,'Welding (3G, 4G, 6G, MIG, TIG Any…)','Welding (3G, 4G, 6G, MIG, TIG Any…)','28.jpg',NULL,NULL,NULL,0,'2023-06-20 09:33:04','2023-06-20 09:33:04'),(29,6,'WELDING & FABRICATION','WF','29.jpg',NULL,'<p><br></p><p data-sourcepos=\"1:1-1:331\" style=\"margin-right: 0px; margin-bottom: 24px; margin-left: 0px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Welding and fabrication are two closely related processes that are used to create metal products. Welding is the process of joining two or more pieces of metal together by melting them and allowing them to cool and resolidify as a single piece. Fabrication is the process of shaping and forming metal into desired shapes and sizes.</p><p data-sourcepos=\"3:1-3:289\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Welding is a critical part of the fabrication process, as it is used to join the different pieces of metal together. However, welding is not the only process involved in fabrication. Other processes, such as cutting, bending, and machining, are also used to create finished metal products.</p><p data-sourcepos=\"5:1-5:188\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Welding and fabrication are used in a wide variety of industries, including construction, manufacturing, and transportation. Some common examples of welded and fabricated products include:</p><ul data-sourcepos=\"7:1-16:0\" style=\"margin: 4px 0px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\"><li data-sourcepos=\"7:1-7:24\" style=\"margin-bottom: 10px;\">Structural steel beams</li><li data-sourcepos=\"8:1-8:17\" style=\"margin-bottom: 10px;\">Ships and boats</li><li data-sourcepos=\"9:1-9:10\" style=\"margin-bottom: 10px;\">Aircraft</li><li data-sourcepos=\"10:1-10:17\" style=\"margin-bottom: 10px;\">Cars and trucks</li><li data-sourcepos=\"11:1-11:23\" style=\"margin-bottom: 10px;\">Bridges and buildings</li><li data-sourcepos=\"12:1-12:23\" style=\"margin-bottom: 10px;\">Oil and gas pipelines</li><li data-sourcepos=\"13:1-13:25\" style=\"margin-bottom: 10px;\">Power generation plants</li><li data-sourcepos=\"14:1-14:27\" style=\"margin-bottom: 10px;\">Food processing equipment</li><li data-sourcepos=\"15:1-16:0\" style=\"margin-bottom: 10px;\">Medical devices</li></ul><p data-sourcepos=\"17:1-17:230\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Welding and fabrication are essential skills for many tradespeople, including welders, metal fabricators, boilermakers, and pipefitters. These tradespeople are responsible for creating the metal products that we rely on every day.</p><p data-sourcepos=\"19:1-19:71\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Here are some of the most common welding processes used in fabrication:</p><ul data-sourcepos=\"21:1-25:0\" style=\"margin: 4px 0px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\"><li data-sourcepos=\"21:1-21:281\" style=\"margin-bottom: 10px;\">Gas metal arc welding (GMAW), also known as MIG welding, is a semi-automatic process that uses a consumable wire electrode to create a weld. GMAW is one of the most popular welding processes, as it is relatively easy to learn and can be used to weld a wide variety of metals.</li><li data-sourcepos=\"22:1-22:292\" style=\"margin-bottom: 10px;\">Shielded metal arc welding (SMAW), also known as stick welding, is a manual arc welding process that uses a consumable electrode rod to create a weld. SMAW is a versatile welding process that can be used to weld a wide variety of metals, including steel, stainless steel, and cast iron.</li><li data-sourcepos=\"23:1-23:270\" style=\"margin-bottom: 10px;\">Gas tungsten arc welding (GTAW), also known as TIG welding, is a manual arc welding process that uses a non-consumable tungsten electrode to create a weld. GTAW is a precision welding process that is often used to weld thin metals and to create high-quality welds.</li><li data-sourcepos=\"24:1-25:0\" style=\"margin-bottom: 10px;\">.</li></ul>','<p><span style=\"color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Flux-cored arc welding (FCAW)&nbsp;is a semi-automatic or automatic welding process that uses a consumable tubular electrode to create a weld. FCAW is a versatile welding process that can be used to weld a wide variety of metals, including steel, stainless steel, and aluminum</span><br></p>',0,'2023-12-20 06:31:37','2023-12-20 06:31:37'),(30,6,'FCAW-3G','WELDING','30.jpg',NULL,'<p><span style=\"color: var(--bard-color-on-surface); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 1rem; white-space-collapse: preserve; background-color: transparent;\">lux-cored arc welding (FCAW) to weld in the vertical up position. This means that the weld is made from the bottom to the top of the joint. FCAW is a semi-automatic welding process that uses a tubular wire electrode containing a flux core. The flux core provides shielding for the weld pool and produces slag to protect the weld from the atmosphere.</span><br></p><div _ngcontent-ng-c1541687105=\"\" class=\"response-container-content ng-tns-c1541687105-21\" style=\"padding-top: 4px; -webkit-box-flex: 1; flex: 1 1 0%; height: auto; min-width: 0px; color: rgba(0, 0, 0, 0.87); font-family: &quot;Times New Roman&quot;; font-size: medium;\"><div _ngcontent-ng-c2875487355=\"\" class=\"response-content ng-trigger ng-trigger-responsePopulation ng-tns-c1541687105-21\" style=\"overflow: hidden;\"><message-content _ngcontent-ng-c2875487355=\"\" class=\"model-response-text ng-tns-c2875487355-20 ng-star-inserted\" _nghost-ng-c3714800863=\"\" id=\"message-content-idr_a4b6a56956ec6040\" style=\"color: var(--bard-color-on-surface); display: block; overflow-x: hidden; width: 1128px; margin-inline-end: 24px; height: auto;\"><div _ngcontent-ng-c3714800863=\"\" class=\"markdown markdown-main-panel\" dir=\"ltr\" style=\"font-size: 1rem; line-height: 1.5rem; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; --animation-duration: 600ms; color: var(--bard-color-on-surface); margin-inline-end: 24px;\"><p data-sourcepos=\"3:1-3:255\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word;\">FCAW-3G is a common welding process used in a variety of industries, including construction, shipbuilding, and manufacturing. It is a versatile process that can be used to weld a variety of materials, including carbon steel, stainless steel, and aluminum.</p><p data-sourcepos=\"5:1-5:268\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word;\">To perform FCAW-3G welding, the welder must first prepare the joint by cleaning and beveling the edges. The welder then selects the appropriate wire electrode and shielding gas, if required. The welder then sets the welding machine to the correct voltage and amperage.</p><p data-sourcepos=\"7:1-7:321\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word;\">Once the welding machine is set up, the welder begins welding by striking an arc at the bottom of the joint. The welder then moves the gun up the joint, maintaining a consistent travel speed and electrode angle. The welder must also pay attention to the weld pool and make adjustments to the welding parameters as needed.</p><p data-sourcepos=\"9:1-9:169\" style=\"margin: 24px 0px; white-space-collapse: preserve; word-break: break-word;\">When the weld is complete, the welder must allow it to cool and then inspect it for any defects. If the weld is acceptable, the welder can then move on to the next weld.</p></div></message-content></div></div>','<ul data-sourcepos=\"13:1-19:0\" style=\"margin: 4px 0px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\"><li data-sourcepos=\"13:1-13:43\" style=\"margin-bottom: 10px;\">Make sure the joint is properly prepared.</li><li data-sourcepos=\"14:1-14:58\" style=\"margin-bottom: 10px;\">Select the appropriate wire electrode and shielding gas.</li><li data-sourcepos=\"15:1-15:62\" style=\"margin-bottom: 10px;\">Set the welding machine to the correct voltage and amperage.</li><li data-sourcepos=\"16:1-16:57\" style=\"margin-bottom: 10px;\">Maintain a consistent travel speed and electrode angle.</li><li data-sourcepos=\"17:1-17:85\" style=\"margin-bottom: 10px;\">Be aware of the weld pool and make adjustments to the welding parameters as needed.</li><li data-sourcepos=\"18:1-19:0\" style=\"margin-bottom: 10px;\">Inspect the weld for defects after it has cooled.</li></ul>',0,'2023-10-18 06:46:15','2023-10-18 06:46:16'),(31,6,'3G,4G & MIG','WELDING','31.jpg',NULL,NULL,NULL,0,'2023-12-12 11:33:26','2023-12-12 11:33:26'),(32,6,'3G FCAW, 4G SMAW','WELODING','32.jpg',NULL,NULL,NULL,0,'2023-10-23 12:34:09','2023-10-23 12:34:09'),(33,6,'3G,4G MIG & 6G TIG WELDER','3G,4G MIG & 6G TIG WELDER','33.jpg',NULL,NULL,NULL,0,'2023-10-25 12:44:41','2023-10-25 12:44:41'),(34,6,'FCAW-3G, ARK','FCAW-3G, ARC','34.jpg',NULL,NULL,NULL,0,'2024-02-08 03:34:10','2024-02-08 03:34:10'),(35,6,'STEEL FIXER','STEEL FIXER','35.jpg',NULL,NULL,NULL,0,'2024-02-18 11:06:13','2024-02-18 11:06:13'),(36,6,'MASON & STEEL FIXER','MASON & STEEL FIXER','36.jpg',NULL,NULL,NULL,0,'2024-06-27 21:58:15','2024-06-27 21:58:15'),(37,6,'QUALITY CONTROL & INSPECTION','QUALITY CONTROL & INSPECTION','37.jpg',NULL,'<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(15, 19, 64);\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent;\">Quality Control Inspection</span>&nbsp;is about maintaining standards and product quality</span>. It’s a systematic process where professionals scrutinize various aspects of a product or service to ensure they meet specific criteria. These criteria could range from safety standards, functionality, to customer satisfaction. The goal of&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(0, 0, 255);\"><a href=\"https://www.marsquality.com/solutions/quality-inspection-services/\" style=\"margin: 0px; padding: 0px; border: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 255);\">quality inspections</a></span></span>? To deliver a product or service that not only meets but often exceeds customer expectations.</span></p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; font-size: 22px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(51, 51, 51); line-height: 1em; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(198, 71, 39);\">A. How Does Quality Control Inspection Work?</span></span></h3><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(15, 19, 64);\">QCI works in stages. First, there’s the planning phase where quality parameters are defined. These are the benchmarks that products or services must meet. Then comes the execution phase. Here, quality inspectors get down to the nitty-gritty. They examine materials, processes, and finished products using a range of techniques from visual inspections to complex testing methods.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(15, 19, 64);\">The process is rigorous. Quality control Inspectors might use statistical sampling – where they test just a part of a batch to draw conclusions about the whole. Or, they may go for 100% inspection, scrutinizing every single unit. Whatever the method, the aim is to identify defects or deviations from the set standards.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(15, 19, 64);\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\">The Role of Quality Control Inspectors</span></span><br><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; color: rgb(15, 19, 64);\">Quality Control Inspectors are the champions of this process. They’re trained to spot issues that might escape an untrained eye. They use specialized equipment, like calipers, gauges, and even computerized testing systems, to measure and test products. Their keen observation and analytical skills ensure that only the best-quality products make it to the market.</span></p>',NULL,0,'2024-10-07 22:14:31','2024-10-07 22:14:31'),(38,6,'Diploma in Forestry Worker','Diploma in Forestry Worker','38.jpg',NULL,'<p>Diploma in Forestry Worker</p>','<p>Diploma in Forestry Worker</p>',0,'2025-05-07 02:53:59','2025-05-07 02:53:59'),(39,6,'Diploma in seller of oil and oil derivatives','Training','39.jpg',NULL,NULL,'<p>Diploma in seller of oil and oil derivatives</p>',0,'2025-05-19 18:05:59','2025-05-19 18:05:59');
