INSERT INTO `pages` (`id`, `added_by`, `page_name`, `image`, `description`, `description_two`, `status`, `created_at`, `updated_at`) VALUES (14,NULL,'About Us','14.jpg','<div>At SDC, we work on the philosophy that both clients and job seekers are an equal and integral part of our company and that the only way forward is to grow together. It is reckoned as one of the reputed and leading Human Resource Consultancy in&nbsp; Bangladesh and continues to expand on strategic locations spread across the globe. We believe in \" treating every customer like the only customer\". We also believe that our professional approach, recruitment criteria, and hard work all contribute to making us one of the leading recruitment agencies in the country. In a very short business time, SDC&nbsp;has been able to achieve a niche for itself by way of exhibiting exemplary customer service to our clients through our representatives and associates located in Singapore, Malaysia, Brunei, KSA, Qatar, UAE, and Maldives.&nbsp; Lastly, success at SDC Human Resource Services Ltd. would not have been possible without the hard work of our dedicated team members.&nbsp;</div>','<div style=\"text-align: justify; \"><div><h4><b><br>History:</b></h4>Skill Development Centre (SDC) – Bangladesh was established in the year 2003. For the decades, we already ushered a significant number of highly skilled manpower to Asia & to other parts of the world.</div><div><br></div><div>SDC Overseas Training & Testing Centre Ltd-Bangladesh is considered to be the largest centre in Asia which was approved by ITE Singapore for MARINE & PCM Sector. At a time, the centre can accommodate 30 welding trainees, 20 steel fitters, 20 pipe fitters, 20 electrical fitters, and 18 mechanical fitters, at a time.</div><div><br></div><div>The centre is fully equipped with facilities such as classrooms, interview rooms, waiting areas, and offices—readily available to provide convenience to our clients as well as to our applicants.</div><div>Similarly, we have workers accommodation prepared for applicants undergoing training and for those residing outside Dhaka. Basically, we have tailored our facilities to meet everyone’s need.</div><div>Furthermore, currently, we have sufficient technical staff employed full-time at the centre.<br></div><div><br></div><div><h4><span style=\"font-weight: 600;\">Company Mission:</span></h4>We aim to be the leading provider of highly competitive manpower from Bangladesh, guided by the international standards of quality, taking pride for its reputation for delivering highly ethical services.</div><div><br></div><div><h4><span style=\"font-weight: 600;\">Company Vision:</span></h4>We dedicate to providing services with almost professionalism, commit ourselves to total quality, with never-ending improvement, and in our service to develop quality and competitive people in any industry to meet and exceed the expectations of the market. <br></div><div><br></div><div><br></div></div>',0,NULL,'2024-05-13 12:58:12'),(20,NULL,'Our Services','20.jpg','<h5><br></h5><h5>SDC Overseas Training and Testing Center Ltd.</h5><h5><br></h5><h5><b>Staffing Management:</b></h5><h6>At SDC Overseas Training and Testing, we specialize in providing commercially focused human resources expertise. By deeply understanding our clients\' business plans, we define, design, develop, and deliver high-quality, leading-edge human resources initiatives tailored to our employers\' specifications.</h6><h5><br></h5><h5><b>Training Development:</b></h5><h6>We are committed to providing thorough training to our candidates for career advancement. Equipped with state-of-the-art facilities, we ensure convenience and quality in our training programs. From personality development to communication and technical skills, we focus on developing well-rounded individuals ready for the challenges of today\'s job market.</h6><h5><br></h5><h5><b>Recruitment &amp; Manpower Pooling:</b></h5><h6>Our services are meticulously tailored to strategically meet the manpower needs of our clients, creating more opportunities for workers. We meticulously understand the requirements, then meticulously plan and prepare the manpower. Our recruitment procedures are well-planned, efficiently performed, carefully coordinated, and regularly updated to ensure the best outcomes for both employers and job seekers.</h6>',NULL,0,NULL,'2024-05-12 13:42:24'),(24,NULL,'Candidate Service',NULL,'<p>1. Skill Training briefing Why SDC</p><p>2. Trade</p><p>3. Trade Picture</p><p>4. Each Trade Description</p><p>5. Course Duration</p><p>6. Course Fees</p><p>7. Certificate Verification</p><p>8. Payment Gateway</p><p>9. Apply Online</p><p>10. Requestation Process</p><ul><li>Name</li><li>Mobile No</li><li>Trade</li></ul>',NULL,0,NULL,'2024-05-11 10:00:34'),(26,NULL,'Skill Training',NULL,'<p><img src=\"data:image/png;base64,\" data-filename=\"01.png\" style=\"width: 100%;\"><br></p>',NULL,0,NULL,'2024-05-12 12:55:48'),(27,NULL,'Terms & Services',NULL,'<p style=\"text-align: justify; \">All driving lessons and courses are operated by Safety Driving Centre (Sel) Sdn. Bhd. (SDC), whose registered office is Lot 3A, Jalan Utara, 46200 Petaling Jaya, Selangor Malaysia. SDC’s operation is subject to, war, terrorist activity, natural disaster, civil strife, adverse weather or road conditions, fire, bureaucratic obstacles, and Road Transport Department of Malaysia (JPJ) regulations. SDC reserves the right to decline any booking / enrolment / at their discretion. The Candidate (s) / student (s) / Driver Learner (s) / Driving candidate (s) are required to sign a copy of the terms and conditions form after reading it. The terms and conditions and all matters arising from it are subject to Malaysian law and the exclusive jurisdiction of the Malaysian Courts. In the event that any of the provisions of this terms and conditions shall be determined by any Court to be invalid, unlawful or unenforceable to any extent then such provision shall to that extent be severed from the remaining provisions of the terms and conditions, which shall continue to be valid and enforceable.</p><p style=\"text-align: justify;\">Safety SDC will take all reasonable precautions to ensure candidate / student safety whilst candidate / student are learning with us; however candidate / student should also take reasonable steps and do candidate / student best to prevent injury or accident to candidate / studentself or others. Follow the instructions of candidate / student Instructor if candidate / student are unsure about anything. If any accident / incidents were to occur due to candidate / student negligence or not of our fault, he or she will be personally be liable for damages.</p><p style=\"text-align: justify;\">The student understands and agrees that he / she is responsible for damages, including collisions that occur in our premises and during drive tests while the candidate is in complete control of the vehicle WITHOUT a BEHIND THE WHEEL DRIVING SCHOOL instructor. The student further understands and agrees that he / she are responsible for any damages or loss caused by the candidate to the SDC’s facilities / properties / vehicles. The candidate understands and agrees that the SDC is not responsible for candidate’s personal belongings that are left or missing in SDC’S facilities, premises or vehicles.</p><p style=\"text-align: justify;\">Conduct of instructor or trainer: SDC will provide trainer / instructor who is professionally trained and who is bound by a professional code of conduct. This will ensure that all SDC trainers will act professionally , polite , tidy and will not smoke in the car while giving driving training. The instructor or trainer are required to behave in a professional and ethical manner at all times. SDC Trainer is required to use SDC ’s and JPJ’s standard operation procedure<br></p>',NULL,0,NULL,'2023-10-23 10:21:13'),(28,NULL,'Privacy Policy',NULL,'<p>Effective Date: [Date]</p><p><br></p><p>This Privacy Policy describes how SDC Overseas Technical Training & Testing Center (\"we,\" \"us,\" or \"our\") collects, uses, discloses, and safeguards personal information obtained from users of the website sdc.com.bd (the \"Site\").</p><p>By accessing and using our Site, you consent to the practices outlined in this Privacy Policy.<br></p><h4><b>Information We Collect</b></h4><p>We may collect both personally identifiable information (PII) and non-personally identifiable information when you use our Site:<br></p><p>Personal Information: We may collect personal information that you voluntarily provide to us, such as your name, email address, phone number, and any other information you submit through forms on our Site.<br></p><p>Non-Personal Information: We may collect non-personal information, including but not limited to your IP address, browser type, operating system, the pages you visit, and the dates and times of your visits.<br></p><h4><b>How We Use Your Information</b></h4><p>We may use the information we collect for various purposes, including:<br></p><p>To provide and maintain the Site.<br></p><p>To respond to your inquiries and requests.</p><p>To personalize your experience on our Site.</p><p>To improve our Site\'s functionality and content.</p><p>To send you updates, newsletters, and marketing communications (if you opt in).</p><p>To monitor and analyze usage patterns on the Site.</p><p>Information Sharing</p><p>We do not sell, trade, or otherwise transfer your personal information to third parties without your consent, except as required by law. We may share your information with trusted third parties who assist us in operating our Site or conducting our business, as long as they agree to keep the information confidential.<br></p><h4><b>Cookies and Similar Technologies</b></h4><p>Our Site may use cookies and similar tracking technologies to enhance your user experience. You can manage your cookie preferences through your browser settings.</p><h4><b>Your Choices</b></h4><p>You have the right to opt out of receiving marketing communications from us. You may also request access to, correction of, or deletion of your personal information in accordance with applicable data protection laws.</p><h4><b>Security</b></h4><p>We take reasonable security measures to protect your personal information from unauthorized access, disclosure, alteration, or destruction. However, no method of data transmission or storage is entirely secure, and we cannot guarantee absolute security.</p><h4><b>Changes to This Privacy Policy</b></h4><p>We may update this Privacy Policy periodically to reflect changes in our information practices. We will post the revised policy on this page, and the updated version will be effective as of the date mentioned at the beginning of the policy.<br></p><h4><b>Contact Information</b></h4><p>If you have any questions or concerns regarding this Privacy Policy, you can contact us at:<br></p><p><span style=\"font-weight: 600;\">SDC Overseas  Training and Testing Center Ltd.</span><br></p><blockquote>House #90,  Block C Thana Road,  Kamar Para Dhour<br><blockquote>(Near Puraton Turag Thana)<br>Turag, Dhaka-1230<br>Email: scdcenterbd@gmail.com<br>Phone: +88 01911 941 194</blockquote></blockquote>',NULL,0,NULL,'2024-05-11 10:06:32');
