INSERT INTO `teams` (`id`, `name`, `designation`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES (2,'Jamshed Hossen Sakib','Executive Director','2.jpg','Bangladesh is a major player in the global garment industry, with a large number of garment factories producing clothing for both domestic and international markets. Garments are one of the country\'s main exports, and the industry employs a significant portion of the country\'s workforce. As a garments buying house, Anytex Design Ltd is likely part of this larger industry, helping to facilitate the production and export of ready-made garments from Bangladesh to customers around the world. I am working closely to make things cost efficient for the company and for the customers.',0,'2023-02-18 12:01:00','2023-02-18 12:01:00'),(3,'Md Suzauddin Howlader','Managing Director','3.jpg','Along with customer satisfaction and quality production we want to create a strong foot print across the globe. Side by side we want to create Anytex as a strong clothing brand in the country. We have a huge clothing market inside the country as well. In that respect, we are going to launch an e-commerce platform and chain shop (Clothing Showroom) in major parts of the country to make good quality garments item available to countryment at a reasonable price. We have a dedicated and efficient team who are working closely to achieve our mission, vision and goals maintaining standard prcatices.',0,'2023-02-18 11:59:27','2023-02-18 11:59:27'),(4,'Sayed Islam-Rizvi','Executive Director and CEO','4.jpg','We are committed to provide high-quality and cost-effective garments to clients while maintaining ethical sourcing practices and meeting all industry standards. We drive to foster strong and long-lasting relationships with suppliers and customers through open communication, reliability and transparency. Therefore, we continuously strive to improve operations and increase efficiency to remain competitive in a dynamic market. We are open to seek out and embrace new technologies and market trends to stay ahead of the curve and meet the changing demands of customers.',0,'2023-02-11 17:20:10','2023-02-11 17:20:10'),(5,'Md Al-Mamun Rana','Chairman','5.jpg','Anytex Design Ltd. is committed to develop close ties with our esteemed customers through personalized services, cooperation, and assistance, which translate into the highest standards in quality, delivery time, and value. Our hands-on and versatile management approach allows us to monitor all the processes, from pre-assessments to shipping, in order to address and comply with all of our customers’ needs and expectations.\r\nTherefore, at Anytex Design Ltd, our mission is to provide high-quality garments to customers around the world while promoting ethical and sustainable practices in the garment industry.',0,'2023-02-18 11:54:01','2023-02-18 11:54:01');
